import React from "react";
import "./UICrearColaborador.css";
import colaborador from "../modelos/colaborador.js";

export default function InterfazCrearColaborador() {

    function crearColaborador(){
        console.log("Crear colaborador");
        let nuevoColaborador = new colaborador(
            "nombre",
            "apellido",
            "correo",
            "telefono",
            "fechaNacimiento",
            "supervisadoPor"
            
        );
    }

    return (
        <div className="App-Crear-Colaborador">
            <form>
            <a>Formulario para creacion de colaboradores</a>
            
            <div className="form-group">
            <input type="text" name="nombre" placeholder="Nombre del empleado"/>
            <input type="text" name="nombre" placeholder="Apellido del empleado"/>
            <input type="text" name="nombre" placeholder="Correo del empleado"/>
            <input type="text" name="nombre" placeholder="Telefono del empleado"/>
            <input type="text" name="nombre" placeholder="Fecha de nacimiento"/>

            </div>
            <div className="form-btns">
            <button type="submit" onClick={crearColaborador}>Crear</button>
            <button type="reset">Limpiar</button>
            </div>
            </form>
        </div>
    );
}
